UNI sampler2D tex;
UNI float time;
UNI vec2 resolution;

IN vec2 texCoord;//UV
{{MODULES_HEAD}}
void main()
{
    vec2 center = -1.0 + 2.0 * texCoord;
    float p = length(center)*2.0;


    p += -3.0 + smoothstep(409.0, 409.25, time)*5.0;

    vec4 c = texture2D(tex, texCoord);
    vec3 fadecolor = vec3(0.0);

    if(time < 2.0){
        c.rgb = fadecolor;
    }

    if(time > 2.0 && time < 400.0){
        c.rgb = mix(fadecolor, c.rgb, smoothstep(2.0, 20.0, time));

    }

    if(time > 400.0){
        c.rgb = mix(vec3(0.0), c.rgb, smoothstep(0.25, -0.25, p));
        //c.rgb = mix(c.rgb, vec3(0.0), smoothstep(409.5, 409.6, time));
    }

    {{MODULE_COLOR}}
    //c.rgb = pow(c.rgb, 1.0/abs(vec3(2.2)));
    outColor = c;
}

